import { mkdirSync, writeFileSync } from 'node:fs';
import { dirname, join } from 'node:path';
import { fileURLToPath } from 'node:url';

// Regenerates the Sweet Balance branding assets from embedded Base64 data so we do not
// need to store binary blobs in git.
const __dirname = dirname(fileURLToPath(import.meta.url));
const assetsDir = join(__dirname, '..', 'assets', 'images');

mkdirSync(assetsDir, { recursive: true });

const assets = [
  {
    name: 'icon.png',
    data: ``
  },
  {
    name: 'android-icon-foreground.png',
    data: ``
  },
  {
    name: 'android-icon-background.png',
    data: ``
  },
  {
    name: 'android-icon-monochrome.png',
    data: ``
  },
  {
    name: 'splash.png',
    data: ``
  },
  {
    name: 'favicon.png',
    data: ``
  }
];

for (const asset of assets) {
  const targetPath = join(assetsDir, asset.name);
  const buffer = Buffer.from(asset.data.replace(/\s+/g, ''), 'base64');
  writeFileSync(targetPath, buffer);
  console.log(`Wrote ${asset.name} (${buffer.length} bytes)`);
}
